function Collect() {
  let meta = {};
  async() => { 
    try { 
      const res = await fetch('https://yesno.wtf/api') 
      const out = await res.json() 
      console.log(out); 
    } catch(err) { 
      throw err
    } 
  }


  return (
    <div className="App">
      <div>{out}</div>
    </div>
  );
}

export default Collect;
